import Post from "./post/Post";
import classes from "./Posts.module.css";

function Posts() {
  return (
    <div className={classes.posts}>
      <div className={classes.area}>
        <textarea></textarea>
        <br />
        <button>Add</button>
        <button>Clear</button>
      </div>
      <div className={classes.postsItem}>
        My posts
        <Post likeCount="15" message="Hi, bird, how are you?" />
        <Post likeCount="20" message="Lets fire" />
        <Post likeCount="7" message="U smell like sheep" />
      </div>
    </div>
  );
}
export default Posts;
